import React from 'react';

const Work6 = () => {
    return (
        <div id='work6' className='tc dib br3 pa3 ma2 bw2 shadow-5 w-75'>
            <p>January '13 - March '16 || 3 years</p>
            <hr></hr>
            <h3>Ice Hockey Coach</h3>
            <p>I was a head coach in the Western Cape Ice Hockey Association, coaching players from age 6 up to the age of 25.</p>
            <p>I was the assistant coach of the under 18 South African National Team for two years.</p>
            <p>I was also the South African representative coach at the IIHF’s Coaching Development and Education Program in Vierumäki, Finland.</p>
            <hr></hr>
            <p>South African Ice Hockey Association</p>
        </div>
    );
}

export default Work6;
